// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;
pragma experimental ABIEncoderV2;
import "./Generador.sol";
import "./Comercializador.sol";
import "./models/InfoContrato.sol";
import "./libraries/Validations.sol";

contract MvmGeneradorFactory {
    address public owner;
    address public dirContrato;

    infoContrato[] generadoresOwners;

    mapping(address => address) public DirContratosGeneradores;

    event CreacionGenerador(string, address);
    using Validations for *;

    constructor() {
        owner = msg.sender;
        dirContrato = address(this);
    }

    function factoryGenerador(
        address _reguladorMercado,
        string memory nombreGenerador
    ) public {
        require(
            msg.sender.aproveCreation(generadoresOwners),
            "Una direccion no puede tener mas de un generador"
        );
        DirContratosGeneradores[msg.sender] = address(
            new Generador(nombreGenerador, msg.sender, _reguladorMercado)
        );
        generadoresOwners.push(
            infoContrato(msg.sender, DirContratosGeneradores[msg.sender])
        );
        emit CreacionGenerador(
            nombreGenerador,
            DirContratosGeneradores[msg.sender]
        );
    }

    function getGeneradoresOwners()
        public
        view
        returns (infoContrato[] memory)
    {
        return generadoresOwners;
    }

    function existeGenerador(
        address contractDir,
        infoContrato[] memory arrayContracts
    ) public pure returns (bool) {
        return contractDir.existsContract(arrayContracts);
    }
}
